import './component.css';
import data from './data';

import Cake from './Cake.js';
let Card = () =>{
   return(
       <div>
   {data.map((each,index)=>{   
       return (
            <div>
                <label>
                <Cake data={data.props.name}></Cake>
                </label>
            </div>
        )

    })}
    </div>
   )
}
export default Card
